        address gateAddress; //合约地址
        string full_name; //全称
        string WhitePaperUrl; //白皮书地址
        string OfficalWebsite; //官网
        string blockExplorerUrl; //区块查询
        string twriterUrl; //区块查询
        string bbsUrl; //bbs论坛地址
    }
}

